import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as e,f as t}from"./app-71f45f98.js";const s="/CoderNotes/assets/image-20230808144613593-4ed4ec9f.png",n="/CoderNotes/assets/image-20230808144635440-2b7b5b61.png",r="/CoderNotes/assets/image-20230808144713413-c08f404e.png",o="/CoderNotes/assets/image-20230808145004492-d568ae36.png",d="/CoderNotes/assets/image-20230808145038926-a7eb2db6.png",h="/CoderNotes/assets/image-20230808145411167-5bdf5df7.png",A="/CoderNotes/assets/image-20230808145933588-728b9397.png",g="/CoderNotes/assets/image-20230808151404160-058488fc.png",c="/CoderNotes/assets/image-20230808151445373-fdc2bfe1.png",p="/CoderNotes/assets/image-20230808151609267-40ff8731.png",l="/CoderNotes/assets/image-20230810094911722-2c518a0e.png",b="/CoderNotes/assets/image-20230810095337416-4b0fe6a1.png",u="/CoderNotes/assets/image-20230810095645284-1ea47d92.png",f="/CoderNotes/assets/image-20230814142109192-61e3c459.png",m="/CoderNotes/assets/image-20230814142121627-8cb29556.png",I="data:image/png;base64,",E="/CoderNotes/assets/image-20230814142302586-9659df32.png",x="/CoderNotes/assets/image-20230814142429700-ae611dba.png",G="/CoderNotes/assets/image-20230814143025722-367d3a3e.png",R="/CoderNotes/assets/image-20230814143110533-4c1846a4.png",C="/CoderNotes/assets/image-20230814143157974-b7117765.png",M="/CoderNotes/assets/image-20230814143259813-b5f223fd.png",v="/CoderNotes/assets/image-20230814143348704-9267d977.png",Y="/CoderNotes/assets/image-20230814143516316-f91174af.png",w="/CoderNotes/assets/image-20230814143651528-5f776061.png",B="data:image/png;base64,",P="data:image/png;base64,",Q="data:image/png;base64,",k="/CoderNotes/assets/image-20230814144706879-166ed62a.png",z="/CoderNotes/assets/image-20230814144734359-12262046.png",D="data:image/png;base64,",j="data:image/png;base64,",U="/CoderNotes/assets/image-20230814144845452-dd48a849.png",N="/CoderNotes/assets/image-20230814144853533-ffc743f5.png",Z="data:image/png;base64,",T="/CoderNotes/assets/image-20230814144908360-b8f5b3d8.png",V="/CoderNotes/assets/image-20230814145323144-e68fce14.png",y="/CoderNotes/assets/image-20230814145333068-74f48c6d.png",O="data:image/png;base64,",W="data:image/png;base64,",q="data:image/png;base64,",H="/CoderNotes/assets/image-20230814145417838-a406c3f4.png",S="data:image/png;base64,",L="/CoderNotes/assets/image-20230814145519244-abfad65f.png",F="/CoderNotes/assets/image-20230814145606614-8f08fb60.png",K={},J=t('<h2 id="uml概述" tabindex="-1"><a class="header-anchor" href="#uml概述" aria-hidden="true">#</a> UML概述</h2><p><code>统一建模语言（Unified Modeling Language，UML）</code>是用来设计软件的可视化建模语言。它的特点是简单、统一、图形化、能表达软件设计中的动态与静态信息。</p><p>UML 从目标系统的不同角度出发，定义了用例图、类图、对象图、状态图、活动图、时序图、协作图、构件图、部署图等 9 种图。</p><h2 id="类图概述" tabindex="-1"><a class="header-anchor" href="#类图概述" aria-hidden="true">#</a> 类图概述</h2><p><code>类图(Class diagram)</code> 是显示了模型的静态结构，特别是模型中存在的类、类的内部结构以及它们与其他类的关系等。类图不显示暂时性的信息。类图是面向对象建模的主要组成部分。</p><h2 id="类图的作用" tabindex="-1"><a class="header-anchor" href="#类图的作用" aria-hidden="true">#</a> 类图的作用</h2><ul><li>在软件工程中，类图是一种静态的结构图，描述了系统的类的集合，类的属性和类之间的关系，可以简化了人们对系统的理解；</li><li>类图是系统分析和设计阶段的重要产物，是系统编码和测试的重要模型。</li></ul><h2 id="类图的表示法" tabindex="-1"><a class="header-anchor" href="#类图的表示法" aria-hidden="true">#</a> 类图的表示法</h2><p>类图通常分为为三层：<br> -- 名称部分(Name) : 在顶端存放;<br> -- 属性部分(Attribute) : 在中间存放属性,属性类型(AttributeType),初始值(InitialValue);<br> -- 方法部分(Operation) : 底部存放操作,参数表(arg:ArgumentType),返回值(ReturnType);</p><p>（接口类型没有属性部分）</p><h3 id="名称部分-name-不同类型类的表示" tabindex="-1"><a class="header-anchor" href="#名称部分-name-不同类型类的表示" aria-hidden="true">#</a> 名称部分(Name) - 不同类型类的表示</h3><p>UML类图中具体类、抽象类、接口和包有不同的表示方法。</p><h4 id="表示具体的类" tabindex="-1"><a class="header-anchor" href="#表示具体的类" aria-hidden="true">#</a> 表示具体的类</h4><p>具体类在类图中用<strong>矩形框表示</strong>，矩形框分为三层：第一层是<strong>类名字</strong>。第二层是类的<strong>成员变量</strong>；第三层是类的<strong>方法</strong>。</p><figure><img src="'+s+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h4 id="表示抽象类" tabindex="-1"><a class="header-anchor" href="#表示抽象类" aria-hidden="true">#</a> 表示抽象类</h4><p>抽象类在UML类图中同样用矩形框表示，但是抽象类的类名以及抽象方法的名字都用斜体字表示，如图所示。</p><figure><img src="'+n+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h4 id="表示接口" tabindex="-1"><a class="header-anchor" href="#表示接口" aria-hidden="true">#</a> 表示接口</h4><p>接口在类图中也是用矩形框表示，但是与类的表示法不同的是，接口在类图中的第一层顶端用构造型 <code>&lt;&lt;interface&gt;&gt;</code>表示，下面是接口的名字，第二层是方法。</p><figure><img src="'+r+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><blockquote><p>此外，接口还有另一种表示法，俗称棒棒糖表示法，就是类上面的一根棒棒糖（圆圈+实线）。圆圈旁为接口名称，接口方法在实现类中出现。</p></blockquote><figure><img src="'+o+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="属性部分-attribute" tabindex="-1"><a class="header-anchor" href="#属性部分-attribute" aria-hidden="true">#</a> 属性部分(Attribute)</h3><h4 id="语法" tabindex="-1"><a class="header-anchor" href="#语法" aria-hidden="true">#</a> 语法</h4><p><strong>属性语法 :</strong><code> [可见性]属性名[ :类型][ =初始值][{属性字符串}] </code>;</p><blockquote><p>注意 : <code>[] </code>中的内容可有可无 ;<br> 属性字符串用来指定关于属性的其它信息 , 不一定是是属性值, 如果希望添加一个属性定义规则 , 但是没地方添加, 可以写在属性字符串中 ;</p></blockquote><h4 id="可见性" tabindex="-1"><a class="header-anchor" href="#可见性" aria-hidden="true">#</a> 可见性</h4><p>成员变量以及方法前的访问修饰符用符号来表示：</p><ul><li>“+” 表示 <code>public</code>；可以在此类的外部使用查看该属性;</li><li>“-” 表示 <code>private</code>；不可以从外部类中访问该属性;</li><li>“#” 表示 <code>protected</code>；常与泛化一起使用;</li><li>不带符号表示 <code>default</code>。</li></ul><h3 id="方法部分-operation" tabindex="-1"><a class="header-anchor" href="#方法部分-operation" aria-hidden="true">#</a> 方法部分(Operation)</h3><h4 id="语法-1" tabindex="-1"><a class="header-anchor" href="#语法-1" aria-hidden="true">#</a> 语法</h4><p><strong>方法语法：</strong><code>[可见性]操作名[( 参数表 )][ : 返回类型][ { 属性字符串 } ]</code>;</p><blockquote><p>注意 : <code>[]</code>中的内容可有可无 ; 如果有多个参数列表的话，中间用逗号隔开</p></blockquote><h4 id="可见性-1" tabindex="-1"><a class="header-anchor" href="#可见性-1" aria-hidden="true">#</a> 可见性</h4><p>可见性 : 主要包括 <strong>公有(public +)</strong>, <strong>私有(private -)</strong>, <strong>受保护(protected #)</strong>, <strong>包内公有(package ~)</strong>;<br> -- 公有 : 用 &quot;+&quot; 表示, 只要调用对象能访问操作所在的包, 就能访问公有操作;<br> -- 私有 : 用 &quot;-&quot; 表示, 同一个类的对象才能调用私有的操作;<br> -- 保护 : 用 &quot;#&quot; 表示, 子类对象才可以调用受保护操作;<br> -- 包内 : 用 &quot;~&quot; 表示, 同一个包内的对象才可以调用包内公有的操作;</p><h2 id="在类图中表示关系" tabindex="-1"><a class="header-anchor" href="#在类图中表示关系" aria-hidden="true">#</a> 在类图中表示关系</h2><p>类和类、类和接口、接口和接口之间存在一定关系，UML类图中一般会有连线指明它们之间的关系。</p><p>关系共有六种类型 ,如下图:</p><figure><img src="'+d+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>为了节省学习成本, 方便记忆,我们可以将类和类之间的关系重新调整一下,使其更加贴近编程的角度:</p><ul><li>实现关系</li><li>泛化关系</li><li>依赖关系</li><li>组合关系 (组合关系+关联关系+聚合关系)</li></ul><blockquote><p>我们也没有必要去区分组合与聚合这两个概念,只需要记住一点就是: <strong>多用组合少用继承</strong><br> 也就是说只要 B 类对象是 A 类对象的成员变量，那我们就称，A 类跟 B 类是组合关系.</p></blockquote><h3 id="实现关系-implements" tabindex="-1"><a class="header-anchor" href="#实现关系-implements" aria-hidden="true">#</a> 实现关系(implements)</h3><p><strong>概念</strong> ：实现关系是接口与实现类之间的关系。在这种关系中，类实现了接口，类中的操作实现了接口中所声明的所有的抽象操作。</p><p><strong>语义</strong>：<br> i. 类和接口之间的关系；<br> ii. 一个类可以实现多个接口，实现所有接口的功能；体现了规范和实现分离的原则</p><p><strong>语法</strong>： <code>implements</code></p><p><strong>表示方式</strong> ：在 UML 类图中，<strong>实现关系使用带空心三角箭头的虚线来表示，箭头从实现类指向接口。</strong></p><p>例如，汽车和船实现了交通工具，其类图:<br><img src="'+h+'" alt="" loading="lazy"></p><h3 id="继承关系-泛化-extends" tabindex="-1"><a class="header-anchor" href="#继承关系-泛化-extends" aria-hidden="true">#</a> 继承关系(泛化-extends)</h3><p><strong>概念</strong> ： 泛化关系是对象之间耦合度最大的一种关系，表示一般与特殊的关系，是父类与子类之间的关系，是一种继承关系。</p><p><strong>语义</strong> ：<br> i. 类和子类的关系，接口和子接口的关系；<br> ii. 一个类（称为子类、子接口）继承另外的一个类（称为父类、父接口）的功能，并可以增加它自己的新功能</p><p><strong>语法</strong>：<code>extends</code></p><p><strong>表示方式</strong> ： 在 UML 类图中，<strong>泛化关系用带空心三角箭头的实线来表示，箭头从子类指向父类。</strong> 在代码实现时，使用面向对象的继承机制来实现泛化关系。</p><p>例如，Student 类和 Teacher 类都是 Person 类的子类，其类图如下图所示：<br><img src="'+A+'" alt="" loading="lazy"></p><h3 id="一般关联关系" tabindex="-1"><a class="header-anchor" href="#一般关联关系" aria-hidden="true">#</a> 一般关联关系</h3><p>关联关系是对象之间的一种引用关系，用于表示一类对象与另一类对象之间的联系，如老师和学生、师傅和徒弟、丈夫和妻子等。关联关系是类与类之间最常用的一种关系，分为一般关联关系、聚合关系和组合关系。类B作为成员变量形成存在于类A中, 简单来说: <strong>A包含B,且A的B创建相互独立</strong></p><p>关联关系又可以分为单向关联，双向关联，自关联。</p><h4 id="单向关联" tabindex="-1"><a class="header-anchor" href="#单向关联" aria-hidden="true">#</a> 单向关联</h4><p>在UML类图中单向关联用一个带箭头的实线表示。上图表示每个顾客都有一个地址，这通过让Customer类持有一个类型为Address的成员变量类实现。</p><figure><img src="'+g+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h4 id="双向关联" tabindex="-1"><a class="header-anchor" href="#双向关联" aria-hidden="true">#</a> 双向关联</h4><p>从上图中我们很容易看出，所谓的双向关联就是双方各自持有对方类型的成员变量。</p><figure><img src="'+c+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>在UML类图中，双向关联用一个不带箭头的直线表示。上图中在Customer类中维护一个<code>List&lt;Product&gt;</code>，表示一个顾客可以购买多个商品；在Product类中维护一个Customer类型的成员变量表示这个产品被哪个顾客所购买。</p><h4 id="自关联" tabindex="-1"><a class="header-anchor" href="#自关联" aria-hidden="true">#</a> 自关联</h4><p>自关联在UML类图中用一个带有箭头且指向自身的线表示。上图的意思就是Node类包含类型为Node的成员变量，也就是“自己包含自己”。</p><figure><img src="'+p+`" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="聚合关系-has-a" tabindex="-1"><a class="header-anchor" href="#聚合关系-has-a" aria-hidden="true">#</a> 聚合关系(has-a)</h3><p>聚合关系是关联关系的一种，表示一种弱的‘拥有’关系，体现的是A对象可以包含B对象，但是B对象不是A对象的一部分,简单来说: <strong>A拥有B,创建A时初始化B,但不创建B</strong></p><div class="language-Java line-numbers-mode" data-ext="Java"><pre class="language-Java"><code>public class University{
	private ArrayList&lt;Teacher&gt; teacherList;
	public University(ArrayList&lt;Teacher&gt; teacherList){
		this.teacherList = teacherList;
	}
}
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><blockquote><p>在代码中: 比如 University 类对象包含 Teacher 类对象，Teacher 类对象的生命周期可以不依赖 University 类对象的生命周期，也就是说可以单独销毁 University 类对象而不影响 Teacher 对象</p></blockquote><p>在 UML 类图中，聚合关系可以用带空心菱形的实线来表示，菱形指向整体。</p><figure><img src="`+l+`" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="组合关系-contains-a" tabindex="-1"><a class="header-anchor" href="#组合关系-contains-a" aria-hidden="true">#</a> 组合关系(contains-a)</h3><p>组合关系是一种强‘拥有’关系，体现了严格的部分和整体的关系，部分和整体的声明周期一样.简单来说: <strong>A创建B,且拥有B</strong></p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Head</span><span class="token punctuation">{</span>
    <span class="token keyword">private</span> <span class="token class-name">Mouth</span> mouth<span class="token punctuation">;</span>
    <span class="token keyword">public</span> <span class="token class-name">Head</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">{</span>
        <span class="token keyword">this</span><span class="token punctuation">.</span>mouth <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Mouth</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><blockquote><p>在代码中: 比如 Head 类对象包含 Mouth 类对象，Mouth 类对象的生命周期依赖 Head 类对象的生命周期，Mouth 类对象不可以单独存在</p></blockquote><p>在 UML 类图中，组合关系用带实心菱形的实线来表示，菱形指向整体。</p><figure><img src="`+b+`" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="依赖关系-uae-a" tabindex="-1"><a class="header-anchor" href="#依赖关系-uae-a" aria-hidden="true">#</a> 依赖关系(uae-a)</h3><p><strong>概念</strong> : 依赖关系是一种使用关系，它是对象之间耦合度最弱的一种关联方式，是临时性的关联。</p><p><strong>语义</strong> : 一个类A使用到了另一个类B，但是这种使用关系是具有偶然性的、临时性的、非常弱的，但是类B的变化会影响到类A</p><p>简单来说: <strong>A不拥有B,但是使用B</strong></p><p><strong>表示方式</strong> : 由类A指向类B的带箭头虚线表示</p><div class="language-Java line-numbers-mode" data-ext="Java"><pre class="language-Java"><code>public class Driver{
    pubilc void driver(Car car){
	    car.move();
    }
}

public class Car{
    pubilc void move(){
	    //汽车驾驶移动...
    }
}
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><blockquote><p>在代码中，某个类的方法通过局部变量、方法的参数或者对静态方法的调用来访问另一个类（被依赖类）中的某些方法来完成一些职责。</p></blockquote><figure><img src="`+u+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="常见uml图" tabindex="-1"><a class="header-anchor" href="#常见uml图" aria-hidden="true">#</a> 常见UML图</h2><h3 id="用例图" tabindex="-1"><a class="header-anchor" href="#用例图" aria-hidden="true">#</a> 用例图</h3><h4 id="概念" tabindex="-1"><a class="header-anchor" href="#概念" aria-hidden="true">#</a> 概念</h4><p>用例图是指由参与者、用例，边界以及它们之间的关系构成的用于描述系统功能的视图。</p><figure><img src="'+f+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="'+m+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><strong>用例图主要用来描述角色以及角色与用例之间的连接关系</strong> 。说明的是谁要使用系统，以及他们使用该系统可以做些什么。一个用例图包含了多个模型元素 ，如系统、参与者和用例，并且显示这些元素之间的各种关系 ，如泛化 、关联 和依赖 。它展示了一个外部用户能够观察到的系统功能模型图。</p><blockquote><p>【用途】：帮助开发团队以一种可视化的方式理解系统的功能需求。</p></blockquote><h4 id="包含元素" tabindex="-1"><a class="header-anchor" href="#包含元素" aria-hidden="true">#</a> 包含元素</h4><h5 id="参与者-actor" tabindex="-1"><a class="header-anchor" href="#参与者-actor" aria-hidden="true">#</a> 参与者(Actor)</h5><p>与应用程序或系统进行交互的用户、组织或外部系统。用一个小人表示 。</p><figure><img src="'+I+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h5 id="用例-use-case" tabindex="-1"><a class="header-anchor" href="#用例-use-case" aria-hidden="true">#</a> 用例(Use Case)</h5><p>用例就是外部可见的系统功能，对系统提供的服务进行描述。用椭圆表示 。</p><figure><img src="'+E+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h5 id="子系统-subsystem" tabindex="-1"><a class="header-anchor" href="#子系统-subsystem" aria-hidden="true">#</a> 子系统(Subsystem)</h5><p>用来展示系统的一部分功能，这部分功能联系紧密。(就是具体的系统功能)</p><figure><img src="'+x+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h4 id="包含关系" tabindex="-1"><a class="header-anchor" href="#包含关系" aria-hidden="true">#</a> 包含关系</h4><p>用例图中涉及的关系有：<strong>关联</strong> 、<strong>泛化</strong> 、<strong>包含</strong> 、<strong>扩展</strong> 。</p><figure><img src="'+G+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h5 id="关联-association" tabindex="-1"><a class="header-anchor" href="#关联-association" aria-hidden="true">#</a> 关联(Association)</h5><p>表示参与者与用例之间的通信，任何一方都可发送或接受消息。</p><p>【箭头指向】：无箭头，将参与者与用例相连接，指向消息接收方</p><figure><img src="'+R+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h5 id="泛化-inheritance" tabindex="-1"><a class="header-anchor" href="#泛化-inheritance" aria-hidden="true">#</a> 泛化(Inheritance)</h5><p>就是通常理解的继承关系，子用例和父用例相似，但表现出更特别的行为；</p><p>子用例将继承父用例的所有结构、行为和关系。子用例可以使用父用例的一段行为，也可以重载它。父用例通常是抽象的。</p><p>在实际应用中很少使用泛化关系，子用例中的特殊行为都可以作为父用例中的备选流存在。</p><p>【箭头指向】：指向父用例</p><figure><img src="'+C+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><blockquote><p>PS：父类的功能少，子类的功能多</p></blockquote><h5 id="包含-include" tabindex="-1"><a class="header-anchor" href="#包含-include" aria-hidden="true">#</a> 包含(Include)</h5><p>包含关系用来把一个较复杂用例所表示的功能分解成较小的步骤。</p><p>包含关系对典型的应用就是复用，也就是定义中说的情景。</p><p>但是有时当某用例的事件流过于复杂时，为了简化用例的描述，我们也可以把某一段事件流抽象成为一个被包含的用例；相反，用例划分太细时，也可以抽象出一个基用例，来包含这些细颗粒的用例。这种情况类似于在过程设计语言中，将程序的某一段算法封装成一个子过程，然后再从主程序中调用这一子过程。</p><p>例如：业务中，总是存在着维护某某信息的功能，如果将它作为一个用例，那添加、修改以及删除都要在用例详述中描述，过于复杂；如果分成添加用例、修改用例和删除用例，则划分太细。这时包含关系可以用来理清关系。</p><p>【箭头指向】：指向<strong>分解出来的功能用例</strong><br><img src="'+M+'" alt="" loading="lazy"></p><p>例如: 预约功能、借书功能都包含 登陆功能，将通用功能（复用功能）提取<br><img src="'+v+'" alt="" loading="lazy"></p><h5 id="扩展-extend" tabindex="-1"><a class="header-anchor" href="#扩展-extend" aria-hidden="true">#</a> 扩展(Extend)</h5><p>扩展关系是指用例功能的延伸，相当于为基础用例提供一个附加功能。</p><p>将基用例中一段相对独立并且可选的动作，用扩展（Extension）用例加以封装，再让它从基用例中声明的扩展点（Extension Point）上进行扩展，从而使基用例行为更简练和目标更集中。</p><p>扩展用例为基用例添加新的行为。扩展用例可以访问基用例的属性，因此它能根据基用例中扩展点的当前状态来判断是否执行自己。但是扩展用例对基用例不可见。</p><p>对于一个扩展用例，可以在基用例上有几个扩展点。</p><p>【箭头指向】：指向基础用例<br><img src="'+Y+'" alt="" loading="lazy"></p><h3 id="状态图" tabindex="-1"><a class="header-anchor" href="#状态图" aria-hidden="true">#</a> 状态图</h3><h4 id="概念-1" tabindex="-1"><a class="header-anchor" href="#概念-1" aria-hidden="true">#</a> 概念</h4><p>状态图(statechart diagram）：用来操述一个特定的对象所有可能的状态，以及哪些事件将导致状态改变。</p><h4 id="包含元素-1" tabindex="-1"><a class="header-anchor" href="#包含元素-1" aria-hidden="true">#</a> 包含元素</h4><p>（1）箭头表示一个转换/一个动作<br> （2）箭头上的文字：表示一个事件<br><img src="'+w+'" alt="" loading="lazy"><br> （3）长方形表示某种状态<br><img src="'+B+'" alt="" loading="lazy"><br> （4）起始状态 ：是一种伪状态，只是表示从这里要开始 （可选）<br><img src="'+P+'" alt="" loading="lazy"><br> （5）结束状态：是一种伪状态，只是表示从这里要结束（可选）<br><img src="'+Q+'" alt="" loading="lazy"></p><p>例如:<br><img src="'+k+'" alt="" loading="lazy"></p><figure><img src="'+z+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h3 id="活动图" tabindex="-1"><a class="header-anchor" href="#活动图" aria-hidden="true">#</a> 活动图</h3><h4 id="概念-2" tabindex="-1"><a class="header-anchor" href="#概念-2" aria-hidden="true">#</a> 概念</h4><p><strong>活动图(activity diagram)</strong> 是UML的动态规图之一，用来描述事物或对象的活动变化流程。类似流程图，描述从一个动作转移到另外一个动作，阐明了业务用例实现的工作流程。</p><h4 id="包含元素-2" tabindex="-1"><a class="header-anchor" href="#包含元素-2" aria-hidden="true">#</a> 包含元素</h4><p>（1）开始：线条表示-活动流(ActionFlow):描述活动之间的有向关系，表示一个活动向另外一个活动之间的转移。用带箭头的实线表示。<br><img src="'+D+'" alt="" loading="lazy"><br> （2）结束：<br><img src="'+j+'" alt="" loading="lazy"><br> （3）活动：<br><img src="'+U+'" alt="" loading="lazy"><br> （4）条件转移（分支）：表示从一个活动按照某种条件转移到几个不同的活动。<br><img src="'+N+'" alt="" loading="lazy"><br> （5）分劈和汇合：表示并发的同步行为，用同步杆表示。 - 》 有分劈、有汇总<br><img src="'+Z+'" alt="" loading="lazy"></p><p>例如:<br><img src="'+T+'" alt="" loading="lazy"></p><h3 id="时序图" tabindex="-1"><a class="header-anchor" href="#时序图" aria-hidden="true">#</a> 时序图</h3><h4 id="概念-3" tabindex="-1"><a class="header-anchor" href="#概念-3" aria-hidden="true">#</a> 概念</h4><p>时序图（Sequence Diagram），又名序列图、循序图，是一种UML交互图，当用户进行某个操作的时候，按照时间的顺序看，各个模块之间如何调用的。描述了方法的调用过程，程序的执行流程，以及方法执行结束的返回值情况。所以用例图当中的一个用例会对应一个时序图，该时序图描述的是该功能/用例具体是怎么实现的，流程是什么。严格情况下，肯定是先设计再开发。</p><h4 id="包含元素-3" tabindex="-1"><a class="header-anchor" href="#包含元素-3" aria-hidden="true">#</a> 包含元素</h4><p>（1）角色(Actor)<br><img src="'+V+'" alt="" loading="lazy"></p><p>（2）对象(Object)<br><img src="'+y+'" alt="" loading="lazy"></p><p>（3）生命线(LifeLine)<br><img src="'+O+'" alt="" loading="lazy"></p><p>（4）控制焦点(Activation)<br><img src="'+W+'" alt="" loading="lazy"><br> PS：控制焦点可以体现生命周期</p><p>（5）消息(Message)<br><img src="'+q+'" alt="" loading="lazy"></p><p>举例：<br><img src="'+H+'" alt="" loading="lazy"></p><h3 id="组件图" tabindex="-1"><a class="header-anchor" href="#组件图" aria-hidden="true">#</a> 组件图</h3><p>组件图用来建立系统的各个组件之间的关系（网站分了多少层，每层有多少组件），它们是通过功能或者文件组织在一起，使用组件图可以帮助读者了解某个功能位于软件包的哪一位置，以及各个版本的软件包含那些功能。如javabean、 ejb 、 jsp都是组件。在UML中，组件元素为：</p><figure><img src="'+S+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>组件图可以用来帮助设计系统的整体构架。</p><p>举例：<br><img src="'+L+'" alt="" loading="lazy"></p><h3 id="部署图" tabindex="-1"><a class="header-anchor" href="#部署图" aria-hidden="true">#</a> 部署图</h3><p>表现用于部署软件应用的物理设备信息</p><figure><img src="'+F+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>',164),X=[J];function _($,aa){return i(),e("div",null,X)}const ta=a(K,[["render",_],["__file","UML图.html.vue"]]);export{ta as default};
